list.TUTORIAL_NEXT_DESCRIPTION:
Il bot funzionerà e gli utenti potranno inviare suggerimenti dopo che `{{prefix}}setup` è stato usato. Se cerchi opzioni più avanzate, come reazioni personalizzate o la pulizia automatica dei comandi, dai un'occhiata a https://suggester.js.org/#/admin/config

Se sei in difficoltà o vuoi saperne di più sul bot, entra nel __server di supporto di Suggester__: {{invite}}
Questo incorporamento può essere mostrato in qualsiasi momento con il comando `{{prefix}}tutorial`.

