list.TUTORIAL_NEXT_DESCRIPTION_NEW:
Dopo aver usato `{{prefix}}setup`, il bot funzionerà e gli utenti saranno in grado di inviare suggerimenti. Se sei in cerca di opzioni più avanzate come cambiare le reazioni ai post nel feed o la pulizia automatica dei comandi, usa `{{prefix}}config`.

Se riscontri problemi, o vuoi saperne di più sul bot, entra nel __server di supporto di Suggester__: {{invite}}
Questo messaggio può essere mostrato in qualsiasi momento con il comando `{{prefix}}tutorial`.

